import { useEffect, useState } from 'react';
import './Modal.css';
import userImg from '../../Images/user.png';
import 'bootstrap/dist/css/bootstrap.min.css';
import bootstrap from '../../../node_modules/bootstrap/dist/js/bootstrap.bundle';

export default function Modal({ closeModal }) {
	const [selectedImg, setSelectedImg] = useState(null);
	const [password, setPassword] = useState('');

	const handleImgClick = (img) => {
		setSelectedImg(img);
	};

	const handleSubmit = (e) => {
		e.preventDefault();
		if (selectedImg && password) {
			// Call the handleLogin function and pass the selectedImg and password
			handleLogin(selectedImg, password);
			// Close the modal
			closeModal();
		} else {
			// Handle validation or show an error message
		}
	};

	return (
		<div className='login-modal'>
			<div className='modal-content'>
				<div className='modal-body image-container'>
					<div className='row d-lg-flex'>
						<div className='col-lg text-center'>
							<img
								className={`rounded-circle ${
									selectedImg === 'avatar1'
										? 'selected-img'
										: ''
								}`}
								alt='avatar1'
								src={userImg}
								onClick={() => handleImgClick('avatar1')}
							/>
							<div className='mb-2'></div>
							<span className='text-lg-center editNames'>
								Antonio
							</span>
						</div>
						<div className='col-lg text-center'>
							<img
								className={`rounded-circle ${
									selectedImg === 'avatar2'
										? 'selected-img'
										: ''
								}`}
								alt='avatar2'
								src={userImg}
								onClick={() => handleImgClick('avatar2')}
							/>
							<div className='mb-2'></div>
							<span className='text-lg-center editNames'>
								Micaela
							</span>
						</div>
						<div className='col-lg text-center'>
							<img
								className={`rounded-circle ${
									selectedImg === 'avatar3'
										? 'selected-img'
										: ''
								}`}
								alt='avatar3'
								src={userImg}
								onClick={() => handleImgClick('avatar3')}
							/>
							<div className='mb-2'></div>
							<span className='text-lg-center editNames'>
								Michelle
							</span>
						</div>
						<div className='col-lg text-center'>
							<img
								className={`rounded-circle ${
									selectedImg === 'avatar4'
										? 'selected-img'
										: ''
								}`}
								alt='avatar4'
								src={userImg}
								onClick={() => handleImgClick('avatar4')}
							/>
							<div className='mb-2'></div>
							<span className='text-lg-center editNames'>
								Santiago
							</span>
						</div>
					</div>
					{selectedImg && (
						<div className='row flex-lg-wrap botaoPositioning '>
							<form onSubmit={handleSubmit}>
								<label
									htmlFor='password'
									className='password-edit'
								>
									PASSWORD:
								</label>
								<input
									type='password'
									id='password'
									name='password'
									value={password}
									onChange={(e) =>
										setPassword(e.target.value)
									}
								/>
								<div className='d-flex bd-highlight mb-3'>
									<div className='p-2 bd-highlight '>
										<div>
											<input
												type='submit'
												className='submitButton'
												id='entradaConta'
												name='entradaConta'
												value='ENTRADA'
											/>
										</div>
									</div>
									<div className='p-2 bd-highlight'>
										<div>
											<input
												type='submit'
												className='submitButton'
												id='saidaConta'
												name='saidaConta'
												value='SAIDA'
											/>
										</div>
									</div>
									<div className='ms-auto p-2 bd-highlight'>
										<div>
											<input
												type='submit'
												className='submit-button'
												value='LOGIN'
											/>
										</div>
									</div>
								</div>
							</form>
						</div>
					)}
				</div>
			</div>
		</div>
	);
}
